import "../../../css/addWindow.css";
export const AddWorkWindow = ({ workList, onSubmitWork }) => {
  if (workList.length)
    window.localStorage.setItem("workList", JSON.stringify(workList));
  return (
    <form autocomplete="off" onSubmit={onSubmitWork}>
      {/* {WorkList.workList} */}
      <input
        className="addWindow__input-name"
        type="text"
        name="workName"
        placeholder="추가할 작업명"
      ></input>
      <input
        className="addWindow__input-time"
        type="number"
        name="workTime"
        placeholder="작업 시간"
      ></input>
      <input type="color" name="workColor"></input>
      <button type="submit">SUBMIT</button>
    </form>
  );
};
